@alexander-doroshko Ah, I see, it does prefix matching.

The problem here is that the current behaviour interferes with a pretty common use case of having selected one completion, deciding it didn't need their needs, and resuming looking in the list for other options. Until your description I would not have thought of clicking after the 'card' text to resume searching. The re-orientation into 'where you were' is fairly important in this context.

It also interferes with the 'what did the UI tell me that I needed to know about card again?' interaction. This happens when people are e.g. trying to remember the option arguments list that appeared. They got to that piece of UI by performing a code completion request, so it's typical that they will try and return there using the same interaction again.
